Korps (berasal dari kata corps, baca "kor" dalam bahasa Prancis dan dari kata korpus dalam bahasa Latin yang berarti ''tubuh") adalah istilah yang digunakan untuk beberapa jenis organisasi. Sebuah inovasi militer oleh Napoleon, formasi ini pertama kali dinamai demikian pada tahun 1805. Dalam terminologi militer, korps mungkin berarti: 
* formasi operasional, kadang-kadang dikenal sebagai korps lapangan, yang terdiri dari dua atau lebih divisi, seperti Corps d'armée, yang kemudian dikenal sebagai I Corps ("Korps Pertama") dari Napoleon Grande Armée); 
* korps administratif (atau pengumpulan) yang merupakan cabang khusus dari dinas militer (seperti korps artileri, , atau pasukan polisi militer) atau; 
* dalam beberapa kasus, layanan yang berbeda dalam militer nasional (seperti Korps Marinir Indonesia). Penggunaan ini sering tumpang tindih. Korps juga dapat menjadi istilah umum untuk organisasi non-militer, seperti Korps Perdamaian AS dan Korps Solidaritas Eropa.

Corps (/kɔːr/; plural corps /kɔːrz/; from French corps, from the Latin corpus "body") is a term used for several different kinds of organization. A military innovation by Napoleon I, the formation was first named as such in 1805. The size of a corps varies greatly, but from two to five divisions and anywhere from 40,000 to 80,000 are the numbers stated by the US Department of Defense. Within military terminology a corps may be: 
* an operational formation, sometimes known as a field corps, which consists of two or more divisions, such as the Corps d'armée, later known as I Corps ("First Corps") of Napoleon I's Grande Armée); 
* an administrative corps (or mustering) – that is a of a military service (such as an artillery corps, a medical corps, or a force of military police) or; 
* in some cases, a distinct service within a national military (such as the United States Marine Corps). These usages often overlap. Corps may also be a generic term for a , such as the US Peace Corps and European Solidarity Corps.
